import React, {useState} from 'react'
import "./ButtonBuy.scss"
import BuyInOneClick from "../ModalForBuy/BuyInOneClick";

export const ButtonForBuy = (props) => {
    const [BuyNowActive, setBuyNowActive] = useState(false)
    return (
        <div className="wrap">
            <button onClick={() => setBuyNowActive = useState(true)}  className="ButtonBuy">Купить</button>
            <BuyInOneClick active={BuyNowActive} setActive={setBuyNowActive}/>
        </div>
    )
}

export default ButtonForBuy;
